webpackJsonp([6478393817263],{378:function(e,o){e.exports={data:{markdownRemark:{html:'<p>For the second time in Singapore and for the first time under the\nPyCon APAC umbrella we will once again host an Education Summit, a\ngathering of educators focused on bringing computational thinking and\ncoding literacy, through Python, to the classroom and the community.</p>\n<p>To find out more, please refer to our <a href="https://pycon.sg/edu-summit/">Education Summit page</a>.</p>\n<p>Additionally, we will also host Young Coders’ Workshops, a series of\nworkshop from students for students (and everyone at age 18 or below.)</p>\n<p>To learn more about the workshops, please refer to our\n<a href="https://pycon.sg/young-coders/">Young Coders’ Workshops page</a>.</p>\n<p>These two are free events, made possible thanks to our sponsors, but they are\nseparate events from the main conference, so if you would like to attend,\nplease fill out the registration form that is linked on the respective event\npages.</p>',frontmatter:{date:"March 19, 2018",path:"/news/edu-summit",title:"Education Summit and Young Coders' Workshops at PyCon APAC 2018"}}},pathContext:{}}}});
